  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0145966 includes physical
  and underway data collected aboard the ROBERT GORDON SPROUL during cruise SP1513
  in the North Pacific Ocean from 2015-06-24 to 2015-06-30. These data include CURRENT
  SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The
  instruments used to collect these data include ADCP and GPS. These data were collected
  by Kenneth H. Coale of Moss Landing Marine Laboratories, and by University of California
  - San Diego; Scripps Institution of Oceanography as part of Collaborative Research:
  Investigations on the Cycling of Mercury from the Ocean to Fog and Deposition to
  Land in Coastal California. The Lamont-Doherty Earth Observatory (LDEO) submitted
  these data to NCEI as part of the NSF sponsored Rolling Deck to Repository (R2R)
  program.nnThe ADCP data represent the raw and automated processed data set. Post
  processed quality assessed data are not available in this accession.\",\n\t\"license_title\":
